import intro_dark_dc_bg from "../image/bg-desktop-dark.jpg";
const IntroBg = () => {
	return (
		<div className="introBg position-absolute">
			<div className="image img-fluid w-100">
				<img className="w-100" src={intro_dark_dc_bg} />
			</div>
		</div>
	);
};

export default IntroBg;
